#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
iostream - системный заголовочный файл стандартной библиотеки, в котором описаны классы для работы с потоками ввода и вывода. В частности, классы ostream, istream, endl, и глобальные переменные cout, cin, cerr, отвечающие за работы со стандартными потоками ввода, вывода и ошибок соответственно.
Потоки ввода и вывода отвечают за ввод и вывод данных, которые "складываются" в эти потоки.
